import { useState } from 'react';
import './App.css';
import Outralista from './components/OutraLista';
import SeuNome from './components/SeuNome';


function App() {

  const teste = {
    nome: "Teste"
  }
  const numeros = [1, 2, 3]
  const comoPassarNoSemestre = [5,5,5]
  const [nome, setNome] = useState()

  return (
    <div className="App">
      <h1>State Lift</h1>
      <Outralista itens={numeros}/>
      <Outralista titulo="Minha meta de aprovação" itens={comoPassarNoSemestre}/>
      <Outralista itens={[]}/>
      <SeuNome setNome={setNome} />
      {nome}
    </div>
  );
}
export default App;
